Deliberado na reunião da Comissão Especial de Riscos Emergências e Desastres a participação do Coordenador Leonardo Maggi Gambatto foi deferida pela Vice presidenta Camila Andrade conforme fluxo :

Considerando o Art. 2º d a Portaria nº 16/2025, de 23 de janeiro de 2025, que dispõe sobre a Política de Representação Institucional do CRP-06 e dá outras providências:

São tipologias de representações institucionais finalísticas de caráter permanente ou eventual:

- Representações em órgãos de controle e participação social das quais o CRP-06 tenha cadeira permanente ou elegível;

- Fóruns e Movimentos Sociais devidamente nomeados;

- Comitês de Ética em Pesquisa devidamente nomeados;

- Entidades da Psicologia devidamente nomeadas;

- Audiências Públicas, Congressos, Seminários, Eventos de interesse do CRP-06, reuniões com Instituições Públicas ou Privadas devidamente nomeadas;

- Formação técnica e administrativa;

- Espaços do Sistema Conselhos de Psicologia devidamente nomeados;

- Outras atividades não ordinárias alinhadas ao plano estratégico e relacionadas com as atividades finalísticas devidamente nomeadas e aprovadas pela vice-presidência do CRP-06.

Considerando o Art. 8º da citada Portaria:

Na atividade de representação institucional do CRP-06 é fundamental que esteja presente a observância aos aspectos éticos e científicos da Psicologia previstos no Código de Ética Profissional do Psicólogo (Resolução CFP nº 010/2005).

Considerando o Art. 11:

É obrigatório o preenchimento do Relatório de Participação em Espaços de Representação Institucional disponibilizado pela Autarquia, que é de responsabilidade da representação e que está no escopo da Vice-Presidência, no prazo máximo de 05 (cinco) dias úteis após a realização da atividade.

Considerando o Art. 17:

Cada Comissão Permanente ou Especial, ao receber o convite institucional encaminhado pela Diretoria, deve indicar sua/seu representante para a VicePresidência, que envia ofício/resposta a fim de acompanhar e atualizar as informações no Estado.

Considerando a Lei n.º 8.653/93, que, em seu art. 1º, dispõe: “É proibido o transporte de presos em compartimento de proporções reduzidas, com ventilação deficiente ou ausência de luminosidade”, estabelecendo regras mínimas para o transporte de presos;

Considerando o artigo 230, inciso II, do Código de Trânsito Brasileiro (CTB), que determina ser proibido “conduzir o veículo transportando passageiros em compartimento de carga, salvo por motivo de força maior, com permissão da autoridade competente e na forma estabelecida pelo CONTRAN”;

Considerando a necessidade da Polícia Civil em realizar escoltas utilizando veículos adequados para o transporte de passageiros e presos, conforme os requisitos legais, e em particular, a necessidade da 9ª Delegacia de Polícia Civil de Extrema de Rondônia (PC/RO), que, em suas operações diárias e missões de segurança pública, emprega veículos de transporte que requerem habilitação na categoria "D" para a condução de veículos com capacidade superior a oito passageiros;

Em cumprimento à legislação, torna-se essencial a mudança de categoria da CNH para categoria "D" dos policiais civis que realizam tais atividades, visto que o Código de Trânsito Brasileiro exige essa habilitação para a condução de veículos usados em escoltas e transporte de presos. A maioria dos policiais lotados na 9ª Delegacia de Extrema atualmente não possui essa categoria, tornando indispensável a contratação de serviços de autoescola.
